import React from 'react';
import CloseIcon from '@mui/icons-material/Close';

const Navbar = () => {
  return (
    <nav style= {{display: "flex", justifyContent:"space-between",backgroundColor: "black", alignItems:"center",fontSize: "10px"}}>
        <div style = {{color:"white"}}>
          Your Notes
        </div>
        <div>
          <CloseIcon style = {{color:"white"}}/>
        </div>
    </nav>
  );
};

export default Navbar;
